import { height } from "@mui/system";
import "./HtmlCss.css";
function HtmlCss() {
  return (
    <div style={{ height: "100vh" }}>
      <div className="topbar">a</div>
      <div className="sidebar">b</div>
    </div>
  );
}

export default HtmlCss;
